  input: TEXT,F3XA,,"The Kern County Republican Central Committee contracts with Western
    Pacific Research (WPR) for its operating and administrative duties.  The Central
    Committee reimburses WPR on a monthly bases for salaries, rent, supplies and all
    operating costs associated with specific projects our committee assigns them.  The
    amount paid to WPR will vary depending on the activities for the month.                                  We
    used our best efforts to obtain the employer and occupation information for Inge
    Wernhart. We contacted her by phone and learned that she is out of the country.
    Her husband is unavailable to answer our questions.    This should clarify the
    Commission's questions concerning our report.  If you have any questions, please
    do not hesitate to call me at (661) 327-9321.  Youre assistance in this matter
    is greatly appreciated. "
